import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { useRouter } from 'next/router';
import Link from 'next/link';

function Header() {
    const navLinks = [
        {
            text: "ùñïùñîùñóùñôùñãùñîùñëùñéùñî",
            link: "/"
        },
        {
            text: "ùñíùñéùñòùñà",
            link: "/misc"
        },
        {
            text: "ùñëùñéùñãùñä",
            link: "/blog"
        },
        {
            text: "ùñÜùñáùñîùñöùñô",
            link: "/about"
        },
        {
            text: "ùñàùñîùñìùñôùñÜùñàùñô",
            link: "/contact"
        }
    ]
    const router = useRouter();
    return <div>
        <h1 className="text-center font-weight-bold mt-5 d-none d-sm-block">ùñóùñäùñëùñëùñéùñîùñò</h1>
        <Navbar expand="sm" className="navbar-light bg-transparent mt-3">
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <h1 className="font-weight-bold d-inline-block d-sm-none" style={{
                position: 'absolute',
                left: '50%',
                top: '0.2em',
                transform: 'translateX(-50%)'
            }}>ùñóùñäùñëùñëùñéùñîùñò</h1>
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav defaultActiveKey="/" activekey={router.pathname} className="mx-auto">
                    {navLinks.map(navItem => {
                        return <Nav.Item key={navItem.text}>
                            <Link href={navItem.link} passHref>
                                <Nav.Link eventKey={navItem.link}><a>{navItem.text}</a></Nav.Link>
                            </Link>
                        </Nav.Item>
                    })}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    </div >
}

export default Header;
